  return (
    <div className="term">
      <dt>
        <span className="emoji" role="img" aria-label="Tense biceps">
          {props.img}
        </span>
        <span>{props.emojiName}</span>
      </dt>
      <dd>{props.emojiDescription}</dd>
    </div>
  );
}

export default Card;
